import { useState, useEffect } from "react";
import axios from 'axios';

function ViewUser(){
    const [user, setuser] = useState([]);

    useEffect(()=>{
        async function getAllUser() {
            try{
                const user = await axios.get('http://127.0.0.1:8000/app/user/');
                console.log(user.data);
                setuser(user.data);
            }
            catch(error){
                console.log(error);
            }
        }
        getAllUser();
    }, [])

    return(
        <>
            <h1>${user.data}</h1>
        </>
    )
};

export default ViewUser();
